define({"topics" : [{"title":"Revision rollback","shortdesc":"\n                        <p class=\"shortdesc\">The rollback feature restores the status of an older checked in revision of any project   item to the current working revision.</p>\n                     ","id":"Project_items_roll_back","href":"TA_Help\/Topics\/Project_items_revision_roll_back.html","menu": {"hasChildren":false,},"tocID":"Project_items_roll_back-d46e21184","topics":[]},{"title":"Viewing history","shortdesc":"\n                        <p class=\"shortdesc\">You can select a checked in revision of any project item to view its history from the    <span class=\"keyword wintitle\">Revision History</span> dialog box.\n                        </p>\n                     ","id":"Project_items_view_history","href":"TA_Help\/Topics\/Project_items_view_history.html","menu": {"hasChildren":false,},"tocID":"Project_items_view_history-d46e21195","topics":[]},{"title":"Revision history comparison","shortdesc":"\n                        <p class=\"shortdesc\">How to view the differences between two historical         revisions of a project item.</p>\n                     ","id":"task_gfl_ytn_bq","href":"TA_Help\/Topics\/ug_Project_items_comparing_revisions.html","menu": {"hasChildren":false,},"tocID":"task_gfl_ytn_bq-d46e21209","topics":[]},{"title":"Filtering displayed revisions","shortdesc":"\n                        <p class=\"shortdesc\">When viewing revision histories of project items, filtering can be used to help         narrow your search.</p>\n                     ","id":"task_dwt_qzx_js","href":"TA_Help\/Topics\/ug_revision_history_filtering.html","menu": {"hasChildren":false,},"tocID":"task_dwt_qzx_js-d46e21220","topics":[]},{"title":"Renaming history","shortdesc":"\n                        <p class=\"shortdesc\">Renaming History stores all records of name changes made to specific project   items.</p>\n                     ","id":"concept_apy_xbt_ts","href":"TA_Help\/Topics\/ug_revision_renaming_history.html","menu": {"hasChildren":false,},"tocID":"concept_apy_xbt_ts-d46e21231","topics":[]},{"title":"Revision tag","shortdesc":"\n                        <p class=\"shortdesc\">In                 <span class=\"ph\">TestArchitect</span>, an AUT version node is used to tag a             specific revision, since a version commonly identifies a specific release\n                           of the AUT,             such as <kbd class=\"ph userinput\">version 1.2</kbd>.\n                        </p>\n                     ","id":"task_ql4_yz2_ks","href":"TA_Help\/Topics\/ug_revision_tag.html","menu": {"hasChildren":false,},"tocID":"task_ql4_yz2_ks-d46e21242","topics":[]}]});